import React, {useState } from 'react'
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';


const Contact = props => {
    const[name, setName] = useState('')
    const[email, setEmail] = useState('')
    const[message, setMessage] = useState('')


    const handleSubmit = ( event ) => {
        event.preventDefault();
        console.log(name, email, message);
    }


    return (
        <div className='contact-page'>
            <h2>E-mail me at <a href = "mailto: abc@example.com">meredithbashert@gmail.com</a></h2>

            <h1>OR</h1>
            <Form className='contact-form' onSubmit='handleSubmit'>
                <Form.Group controlId="formName" >
                    <Form.Label>Name*</Form.Label>
                    <Form.Control type="text"  id='name'  value={name} onChange={e => setName(e.target.value)}/>
                </Form.Group>

                <Form.Group controlId="formEmail">
                    <Form.Label>E-mail*</Form.Label>
                    <Form.Control type="email"  id='email'  value={email} onChange={e => setEmail(e.target.value)}/>
                </Form.Group>

                <Form.Group controlId="formMessage">
                    <Form.Label>Message*</Form.Label>
                    <Form.Control as="textarea" rows="4"  id='message'  value={message} onChange={e => setMessage(e.target.value)}/>
                </Form.Group>

                <Button variant="primary" type="submit">
                    Submit
                </Button>
            </Form>
        </div>
    )
}


export default Contact
